import axios from 'axios';
import React,{useState} from 'react';
import Connection from '<div className=""></div>/src/Connection.js'

function Register() {

const [register,setRegister]= useState({});
    function  handleChange(e){
        setRegister({
            ...register,
            [e.target.name]:e.target.value
        })
    }

    const handleSubmit = async ()=>{
        const response = await axios.post()
    }
    return (
        <div className="container">
            <div className="row">
                <div className="col">
                    <form>
                    <div className="mb-3">
                            <label htmlFor="exampleInputUsername1" className="form-label">Email address</label>
                            <input type="Username" name='username' value={register.username} onChange={handleChange} className="form-control" id="exampleInputUsername1" aria-describedby="emailHelp" />
                            <div id="UsernameHelp" className="form-text">We'll never share your email with anyone else.</div>
                        </div>
                        <div className="mb-3">
                            <label htmlFor="exampleInputEmail1" className="form-label">Email address</label>
                            <input type="email" name='email'  value={register.email}   onChange={handleChange}  className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
                            <div id="emailHelp" className="form-text">We'll never share your email with anyone else.</div>
                        </div>
                        <div className="mb-3">
                            <label htmlFor="exampleInputPassword1" className="form-label">Password</label>
                            <input type="password" name='password' value={register.password}  onChange={handleChange}  className="form-control" id="exampleInputPassword1" />
                        </div>

                        <button type="submit" className="btn btn-primary" onSubmit={handleSubmit}>Submit</button>
                    </form>


                </div>
            </div>
        </div>
    )
}

export default Register
